age{display:table-cell;vertical-align:middle}.elementor-testimonial-wrapper .elementor-testimonial-meta .elementor-testimonial-image img{width:60px;height:60px;border-radius:50%;-o-object-fit:cover;object-fit:cover;max-width:none}.elementor-testimonial-wrapper .elementor-testimonial-meta.elementor-testimonial-image-position-aside .elementor-testimonial-image{padding-left:15px}.elementor-testimonial-wrapper .elementor-testimonial-meta.elementor-testimonial-image-position-aside .elementor-testimonial-details{text-align:right}.elementor-testimonial-wrapper .elementor-testimonial-meta.elementor-testimonial-image-position-top .elementor-testimonial-details,.elementor-testimonial-wrapper .elementor-testimonial-meta.elementor-testimonial-image-position-top .elementor-testimonial-image{display:block}.elementor-testimonial-wrapper .elementor-testimonial-meta.elementor-testimonial-image-position-top .elementor-testimonial-image{margin-bottom:20px}</style>							\"Fuerat aestu carentem habentia spectent tonitrua mutastis locavit liberioris.\"\n- Adam Sendler\n<h2>Upcoming Events</h2>\n<img width=\"644\" height=\"402\" src=\"https://khaled5077.com/wp-content/uploads/2020/01/hiking-v1.jpg\" alt=\"\" loading=\"lazy\" srcset=\"https://i0.wp.com/khaled5077.com/wp-content/uploads/2020/01/hiking-v1.jpg?w=644&amp;ssl=1 644w, https://i0.wp.com/khaled5077.com/wp-content/uploads/2020/01/hiking-v1.jpg?resize=300%2C187&amp;ssl=1 300w\" sizes=\"(max-width: 644px) 100vw, 644px\">\n\n<style>/*! elementor - v3.13.3 - 28-05-2023 */<br />\n.elementor-widget-image-box .elementor-image-box-content{width:100%}@media (min-width:768px){.elementor-widget-image-box.elementor-position-left .elementor-image-box-wrapper,.elementor-widget-image-box.elementor-position-right .elementor-image-box-wrapper{display:flex}.elementor-widget-image-box.elementor-position-right .elementor-image-box-wrapper{text-align:left;flex-direction:row}.elementor-widget-image-box.elementor-position-left .elementor-image-box-wrapper{text-align:right;flex-direction:row-reverse}.elementor-widget-image-box.elementor-position-top .elementor-image-box-img{margin:auto}.elementor-widget-image-box.elementor-vertical-align-top .elementor-image-box-wrapper{align-items:flex-start}.elementor-widget-image-box.elementor-vertical-align-middle .elementor-image-box-wrapper{align-items:center}.elementor-widget-image-box.elementor-vertical-align-bottom .elementor-image-box-wrapper{align-items:flex-end}}@media (max-width:767px){.elementor-widget-image-box .elementor-image-box-img{margin-left:auto!important;margin-right:auto!important;margin-bottom:15px}}.elementor-widget-image-box .elementor-image-box-img{display:inline-block}.elementor-widget-image-box .elementor-image-box-title a{color:inherit}.elementor-widget-image-box .elementor-image-box-wrapper{text-align:center}.elementor-widget-image-box .elementor-image-box-description{margin:0}</style>\n<h5>Everest Camp Trek</h5>\nFuerat aestu carentem habentia spectent tonitrua mutastis locavit liberioris inistra possedit.\n\n<a href=\"#\" role=\"button\">\nLearn More\n</a>\n<img width=\"644\" height=\"402\" src=\"https://khaled5077.com/wp-content/uploads/2020/01/walking-v1.jpg\" alt=\"\" loading=\"lazy\" srcset=\"https://i0.wp.com/khaled5077.com/wp-content/uploads/2020/01/walking-v1.jpg?w=644&amp;ssl=1 644w, https://i0.wp.com/khaled5077.com/wp-content/uploads/2020/01/walking-v1.jpg?resize=300%2C187&amp;ssl=1 300w\" sizes=\"(max-width: 644px) 100vw, 644px\">\n<h5>Walking Holidays</h5>\nFuerat aestu carentem habentia spectent tonitrua mutastis locavit liberioris inistra possedit.\n\n<a href=\"#\" role=\"button\">\nLearn More\n</a>\n<h2>Explore The World</h2>\nDiremit mundi mare undae nunc mixtam tanto sibi. Nubes unda concordi. Fert his. Recessit mentes praecipites locum caligine sui egens erat. Silvas caeli regna.\n<a href=\"#\" role=\"button\">\nLearn More\n</a>\n<h2>Upcoming Tours &amp; Destination</h2>\nFuerat aestu carentem habentia spectent tonitrua mutastis locavit liberioris. Sinistra possedit litora ut nabataeaque. Setucant coepyterunt perveniunt animal! Concordi aurea nabataeaque seductaque constaque cepit sublime flexi nullus.\n\n<a href=\"#\" role=\"button\">\nLearn More\n</a>\n<img width=\"644\" height=\"402\" src=\"https://khaled5077.com/wp-content/uploads/2021/02/outdoor-image-01.jpg\" alt=\"\" loading=\"lazy\" srcset=\"https://i0.wp.com/khaled5077.com/wp-content/uploads/2021/02/outdoor-image-01.jpg?w=644&amp;ssl=1 644w, https://i0.wp.com/khaled5077.com/wp-content/uploads/2021/02/outdoor-image-01.jpg?resize=300%2C187&amp;ssl=1 300w\" sizes=\"(max-width: 644px) 100vw, 644px\">\n<img width=\"378\" height=\"385\" src=\"https://khaled5077.com/wp-content/uploads/2018/11/image-1.jpg\" alt=\"\" loading=\"lazy\" srcset=\"https://i0.wp.com/khaled5077.com/wp-content/uploads/2018/11/image-1.jpg?w=378&amp;ssl=1 378w, https://i0.wp.com/khaled5077.com/wp-content/uploads/2018/11/image-1.jpg?resize=295%2C300&amp;ssl=1 295w\" sizes=\"(max-width: 378px) 100vw, 378px\">\n<img width=\"378\" height=\"385\" src=\"https://khaled5077.com/wp-content/uploads/2018/11/snow-1.jpg\" alt=\"\" loading=\"lazy\" srcset=\"https://i0.wp.com/khaled5077.com/wp-content/uploads/2018/11/snow-1.jpg?w=378&amp;ssl=1 378w, https://i0.wp.com/khaled5077.com/wp-content/uploads/2018/11/snow-1.jpg?resize=295%2C300&amp;ssl=1 295w\" sizes=\"(max-width: 378px) 100vw, 378px\">\n<img width=\"379\" height=\"218\" src=\"https://khaled5077.com/wp-content/uploads/2021/02/outdoor-image-04.jpg\" alt=\"\" loading=\"lazy\" srcset=\"https://i0.wp.com/khaled5077.com/wp-content/uploads/2021/02/outdoor-image-04.jpg?w=379&amp;ssl=1 379w, https://i0.wp.com/khaled5077.com/wp-content/uploads/2021/02/outdoor-image-04.jpg?resize=300%2C173&amp;ssl=1 300w\" sizes=\"(max-width: 379px) 100vw, 379px\">','الرئيسية','','inherit','closed','closed','','540-revision-v1','','','2023-06-06 17:14:38','2023-06-06 14:14:38','',540,'https://khaled5077.com/?p=582',0,'revision','',0);
